import React from 'react';
import doggo from './img/doggo.jpg';
import './poster.css';


class Poster extends React.Component{
  render(){
    return <img className = 'poster' src = {doggo} onClick={()=>{this.props.history.push('/secondpage');}} />
  }
}





export default Poster;
